import Sidebar from '../components/Sidebar';
import Layout from '../components/Layout';
import Tasks from '../components/Tasks';
export default () => {
	return (
		<Layout>
			<div className="lg:flex sm:w-3/4 mx-auto sm:mx-0 items-center">
				<div>
					<div className="mx-4 sm:p-4 py-12 bg-white shadow-lg rounded-md"></div>
					<div className="mx-4 mt-20 sm:p-4 py-12 bg-white shadow-lg rounded-md"></div>
				</div>
			</div>
		</Layout>
	);
};
